// src/components/CountryDetailPage.jsx
import { useEffect } from 'react';
import { useNavigate, useParams } from 'react-router-dom';
import logo from '../images/dept-logo.png';
import BackButton from './BackButton';

export default function CountryDetailPage({ token, logout }) {
  const { code } = useParams();
  const navigate = useNavigate();

  // Redirect back home if not authenticated
  useEffect(() => {
    if (!token) {
      navigate('/');
    }
  }, [token, navigate]);

  const handleLogout = () => {
    logout();
    navigate('/');
  };

  // You could fetch more info here by code (e.g. via restcountries), 
  // but for now we'll just use the code as the title.
  const countryName = code;

  return (
    <div className="relative min-h-screen bg-gray-100">
      {/* Fixed Top Bar */}
      <div className="fixed top-0 left-0 w-full bg-gray-100 z-20 flex items-center justify-between px-4 py-2 shadow-none">
        <div className="flex items-center space-x-2">
          <img src={logo} alt="Dept Logo" className="w-12 h-auto" />
          <BackButton to="/solution" />
        </div>
        {token && (
          <button onClick={handleLogout} className="btn">
            Log out
          </button>
        )}
      </div>

      {/* Spacer to push content below nav */}
      <div className="pt-16" />

      {/* Country Title */}
      <h1 className="text-4xl font-bold text-gray-800 text-center mt-6">
        {countryName}
      </h1>

      {/* Embedded Google Map */}
      <div className="mt-6 w-full flex justify-center">
        <iframe
          title={`map-${countryName}`}
          src={`https://maps.google.com/maps?q=${encodeURIComponent(countryName)}&output=embed`}
          className="w-full max-w-4xl h-96 rounded shadow"
          allowFullScreen
        />
      </div>
    </div>
  );
}
